import styled from 'styled-components';

export const AboutContainer = styled('div')`
    display: flex;
    flex-direction: column;
    align-items: center;
`

export const Row = styled('div')`
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-evenly;
    width: 100%;
`;
